function removeActiveClassCharts(){buttonSwitchChart.forEach(t=>t.classList.remove("active")),chartOpen.forEach(t=>t.classList.remove("active-chart"))}function removeActiveClassCes(){buttonSwitchCes.forEach(t=>t.classList.remove("active")),cesOpen.forEach(t=>t.classList.remove("active-ces"))}let buttonSwitchChart=document.querySelectorAll(".change-btn"),chartOpen=document.querySelectorAll(".exam-graph ");for(let t=0;t<buttonSwitchChart.length;t++)buttonSwitchChart[t].onclick=function(){removeActiveClassCharts(),buttonSwitchChart[t].classList.add("active"),chartOpen[t].classList.add("active-chart")};let buttonSwitchCes=document.querySelectorAll(".ces-content_toggle-btn"),cesOpen=document.querySelectorAll(".ces-content_text");for(let t=0;t<buttonSwitchCes.length;t++)buttonSwitchCes[t].onclick=function(){removeActiveClassCes(),buttonSwitchCes[t].classList.add("active"),cesOpen[t].classList.add("active-ces")};